    "YFNWR project report number 86-4: The feasibility of a proposed study to estimate
    beaver abundance on the Yukon Flats National Wildlife Refuge: Management study",nt"tracking_summary":
    {ntt"total": 10,ntt"recent": 3nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T23:02:24.726368",nt"name": "yfnwr-project-report-number-86-4-the-feasibility-of-a-proposed-study-to-estimate-beaver-ab",nt"isopen":
    false,nt"url": null,nt"notes": "A survey was conducted for the Yukon Flats
    National Wildlife Refuge (YFNWR) in summer 1985 to assess the feasibility of a proposed
    study to estimate beaver colony size through observations of active lodges in autumn.
    The objective of this proposed study is to determine if the number of beavers in
    a colony is positively related to the size of the food cache associated with the
    lodge. Such a relationship is believed by trappers to exist, and it has been proposed
    for study in the past in the Lower Yukon-Kuskokwim Region in southwestern Alaska.
    The information would be used in YFNWR to 1) supplement the current trend counts
    of caches in order to give estimates of actual beaver abundance, and 2) better evaluate
    harvests and the status of populations within selected areas and the refuge as a
    whole (McLean 1985). In this report, we will discuss the results of a field reconnaissance
    of active beaver lodges and review the literature on beaver ecology and census methods.
    We conclude with a statement of feasibility and our procedural recommendations.",nt"license_title":
